$(document).ready(function() {
  // var test = navigator.userAgent;
  // $('.title').append(test);
  var infiniteLoopAlternate = anime({
    targets: '#start',
    translateY: 10,
    direction: 'alternate',
    loop: true,
    autoplay: false,
  });

  var progressBar = anime({
    targets: '#progress',
    d: 'M 317.502 383.522 C 411.961 383.522 475.996 383.522 475.996 383.522',
    easing: 'easeInOutExpo',
    duration: 1000,
    complete: function(anim) {
      $('#loading, #loading-progress').animate({
        opacity: '0'
      }, 800, function() {
        $(this).addClass('hidden');
        $('#snowman').removeClass('hidden').animate({
          opacity: '1',
        }, 1000, function() {
          $('#start').removeClass('hidden').animate({
            opacity: '1',
          },function() {
            infiniteLoopAlternate.play();
          });
        });
      });
    },
  });

  $('.category').on('click', function() {
    $(this).addClass('selected').siblings().removeClass('selected');
    var cat = this.getAttribute('data-cat');
    var themes = components[cat];

    for (var theme in themes) {
      $('.theme-' + theme).html(themes[theme]);
    }

    var selected = $('#' + cat).children(':not(.hidden)').data('name');
    $('.theme').removeClass('selected');
    $('.theme[data-theme="' + selected + '"]').addClass('selected');
  });

  $('.theme').on('click', function() {
    $(this).addClass('selected').siblings().removeClass('selected');

    var theme = this.getAttribute('data-theme');
    var dataCat = $('.category.selected').data('cat');
    var category = $('#' + dataCat);
    category.children('[data-name="' + theme + '"]').removeClass('hidden').siblings().addClass('hidden');

    if (
      $('#background .hidden').length < 5 && $('#background #default-bg.hidden').length === 1 &&
      $('#accessories .hidden').length < 4 && 
      $('#outfits .hidden').length < 4 && 
      $('#decorations .hidden').length < 4 && 
      $('#message .hidden').length < 4) {
        $('#finish').removeClass('hidden').animate({
          opacity: '1',
        });
    }
  });

  // do this only once, stop animation and hide it from the view
  $('.theme').one('click', function() {
    infiniteLoopAlternate.pause();
    $('#start').animate({
      opacity: '0',
    },function() {
      $(this).addClass('hidden');
    });
  })

  // Download to image on clicked
  $('.btn-download').on('click', function() {
    var canvas = document.getElementById('canvas');
    var canvasFabric = new fabric.Canvas('canvas');

    // clone and remove all hidden elements then convert to string
    var svg = $('.main-content > svg')
      .clone()
      .find('.hidden, #finish')
      .remove()
      .end();
    svg = new XMLSerializer().serializeToString(svg[0]);

    //add content to canvas and download
    fabric.loadSVGFromString(svg, function(objects, options) {
      var obj = fabric.util.groupSVGElements(objects, options);
      canvasFabric.add(obj).renderAll();

      canvas.toBlob(function(blob) {
        if (!navigator.userAgent.match('CriOS')) {
          saveAs(blob, 'e-card.png');
        } else {
          var reader = new FileReader();
          reader.onload = function() {
            window.location.href = reader.result;
          }
          reader.readAsDataURL(blob);
        }
      });
    });
  })
});